I looked a bit at the alma response. It includes all barcodes on a patron's record, both active and inactive. 

The structure looks like this in JSON

```{
      "value": "22101xxxxxxx37",
      "id_type": {
        "value": "BARCODE",
        "desc": "Barcode"
      },
      "note": "02 Sep 2015",
      "status": "INACTIVE",
      "segment_type": "Internal"
    },
    {
      "value": "22101xxxxxxx47",
      "id_type": {
        "value": "BARCODE",
        "desc": "Barcode"
      },
      "note": "01 Mar 2016",
      "status": "ACTIVE",
      "segment_type": "Internal"
    },```

The "incorrect" inactive barcode we are seeing show up in the patron request in SCSB appears to be the first barcode that appears in the identifiers array in the Alma API user response, https://developers.exlibrisgroup.com/alma/apis/docs/users/R0VUIC9hbG1hd3MvdjEvdXNlcnMve3VzZXJfaWR9/. I cannot see that the bibdata patron route ever sends back the incorrect inactive barcode though so I'm still unclear how the request form is passing over the incorrect barcode.
